import React from 'react';

const BoardListItem = (props) => {

    let {post} = props;
    let created = new Date(item.created);

    return (
        <tr key={item.id}>
            <th scope="row">{item.title}</th>
            <td>{item.content}</td>
            <td><div>{created.getFullYear()}/
                {created.getMonth() + 1}/
                {created.getDate()}&nbsp
                {created.getHours()}:
                {created.getMinutes()}:
                {created.getSeconds()}
            </div></td>
        </tr>
    );
};

export default BoardListItem;
